import classes from './MapBlock.module.scss';
import React from 'react';


const MapBlock = () => {
    const [mapLocation, setMapLocation] = uses({
        lat: 30.239248,
        lng: -97.768896,
      });
    return(
        <div className={classes.mapBlock}>
            <h2 className={classes.title}>Visit Our current store</h2>
            <LocationList locationHandler={setMapLocation} />
        </div>
    )
};

export default MapBlock;
